import React from 'react';
import Sidebar from '../components/Sidebar/Sidebar';
import About from '../components/Abouts/About';
import './styles.css';

const AboutPage = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <About />
    </div>
  );
};

export default AboutPage;
